import React from 'react';

const Contact = () => {
    return (
        <div className='w-full h-screen text-gray-200 bg-[#0a192f] flex justify-center items-center'>
            <div className='max-w-[800px] mx-auto px-8'>
                <div className='text-center pb-8'>
                    <h2 className='text-5xl font-bold border-b-4 border-pink-600 inline-block'>
                        Contact
                    </h2>
                </div>
                <div className='text-center'>
                    <p className='text-3xl text-[#4ecad3] font-bold border-pink-600 hover:text-purple-600 hover:border-b-2 cursor-pointer'>
                        <a href="https://discord.gg/uxDgVAJcSN" target="_blank" rel="noopener noreferrer">
                            Click here for more of my creations!
                        </a>
                    </p>
                </div>
                <div className='text-center pt-8'>
                    <p className='text-2xl text-[#8d8dca] font-bold'>Thanks for showing interest in my work!</p>
                    <p className='text-4xl text-pink-600 font-bold mt-4'>You can message me on Discord: wulu#0827</p>
                </div>
            </div>
        </div>
    );
};

export default Contact;
